import React from "react";

import ButtonStyledComp from "./ButtonStyledComp";

import classes from "./styles.module.css";

interface Props {
  title: string;
  imgContent?: any;
  background: string;
  paddingParam: string;
  boxShadowParam: string;
  onClick: () => void;
}

export const Button: React.FC<Props> = ({
  title,
  imgContent,
  background,
  paddingParam,
  boxShadowParam,
  onClick,
}) => {
  return (
    <div className={classes.container}>
      <ButtonStyledComp
        // className={classes.btn}
        onClick={onClick}
        backgroundColor={background}
        padding={paddingParam}
        boxShadow={boxShadowParam}
      >
        {/* <button className={classes.btn} onClick={onClick} > */}
        {title}
        {imgContent && <img src={imgContent} alt="/" className={classes.img} />}
        {/* </button> */}
      </ButtonStyledComp>
    </div>
  );
};
